INSERT INTO "public"."Log" VALUES ('d84139fb-43b2-4be0-8705-bc4b70cf08ee', 'dddd7ba9-c1d4-4a6b-b946-f05e2f79880f', '127.0.0.1', '/administrative/message', 'POST', '{"title": "一个理发师带火一座城？遭同行抵制：把整个行业搞完了！央妈力挺", "pinned": false, "status": "ACTIVE", "content": "<p class=\"ql-align-justify\">这几日，湖南怀化的一位女理发师晓华彻底火了。她不仅能听懂顾客的话，而且技术很好，剪完头发后顾客都感觉像变了个人似的，每次都能让顾客满意而归。</p><p class=\"ql-align-center\"><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2024%2F1108%2F55ca4528j00smmluw0018d000hs00dhg.jpg&amp;thumbnail=660x2147483647&amp;quality=80&amp;type=jpg\"></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">晓华只靠发布自己给顾客剪头发的视频，在社交平台上就吸引了超过200万的新粉丝。</p><p class=\"ql-align-center\"><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2024%2F1108%2F9e2fe69dj00smmlux001jd000hs00fkg.jpg&amp;thumbnail=660x2147483647&amp;quality=80&amp;type=jpg\"></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">现在有很多人听说了晓华的店，都跑来排队，门口排成了长龙。</p><p><br></p>"}', 'Windows 10', 'Chrome', '2024-11-08 10:03:22.707');
INSERT INTO "public"."Log" VALUES ('605be99a-a74b-44d4-b542-69fdcbdf43e1', 'dddd7ba9-c1d4-4a6b-b946-f05e2f79880f', '127.0.0.1', '/administrative/message/9f1029f8-5d40-4b76-b26e-bd3388402f5a', 'PUT', '{"title": "一个理发师带火一座城？遭同行抵制：把整个行业搞完了！央妈力挺", "pinned": true, "status": "INACTIVE", "content": "<p class=\"ql-align-justify\">这几日，湖南怀化的一位女理发师晓华彻底火了。她不仅能听懂顾客的话，而且技术很好，剪完头发后顾客都感觉像变了个人似的，每次都能让顾客满意而归。</p><p class=\"ql-align-center\"><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2024%2F1108%2F55ca4528j00smmluw0018d000hs00dhg.jpg&amp;thumbnail=660x2147483647&amp;quality=80&amp;type=jpg\"></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">晓华只靠发布自己给顾客剪头发的视频，在社交平台上就吸引了超过200万的新粉丝。</p><p class=\"ql-align-center\"><img src=\"https://nimg.ws.126.net/?url=http%3A%2F%2Fdingyue.ws.126.net%2F2024%2F1108%2F9e2fe69dj00smmlux001jd000hs00fkg.jpg&amp;thumbnail=660x2147483647&amp;quality=80&amp;type=jpg\"></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">现在有很多人听说了晓华的店，都跑来排队，门口排成了长龙。</p>"}', 'Windows 10', 'Chrome', '2024-11-08 10:04:29.385');
